import React from "react";
import Master from "../Layout/Master";

export default function Home() {
  return <Master>
      <div className="container">
          <div className="row">
              <div className="col-md-3">
                  <div className="card"></div>
              </div>
          </div>
      </div>
  </Master>;
}
